import React from 'react';
import {Row, Col} from 'react-bootstrap';
import { FeatureContent } from './DataFeature';
import styles from './BoxFeature.module.scss';
import p1 from '../../../img/images/features_icon_s.png'
const BoxFeature = () =>{
    return(
        <Row bsPrefix={styles.fixed}>
            {FeatureContent.map((items, index) =>{
                return <Col key={index} xs={12} sm={6} md={6} lg={3}>
                    <div className={styles.images}>
                        <img src={p1}/>
                        <img className={styles.img2} src={items.link}/>
                    </div>
                    <div className={styles.content}>
                        <p>{items.title}</p>
                        <p>{items.content}</p>
                    </div>
                </Col>
            })}
        </Row>
    )
}

export default BoxFeature;
